import React from 'react';
import { NavLink } from 'react-router-dom';

function Sidebar() {
  return (
    <div className="sidebar">
      <NavLink to="/" exact activeClassName="active">Ürünler</NavLink>
      <NavLink to="/categories" activeClassName="active">Kategoriler</NavLink>
      <NavLink to="/customers" activeClassName="active">Müşteriler</NavLink>
      <NavLink to="/orders" activeClassName="active">Sipariş & Fatura</NavLink>
    </div>
  );
}

export default Sidebar;
